ALGORITHM UniqueElements(A[0.n-1])
// Determines whether all elements in a given array are distinc
// Input: An array A[0..n-1]
// Output: true if all elements are distinct and false otherwise for i <- 0 to n - 2 do for j <- i + 1 to n - 1 do if A[i] = A[j] return false return true The worst case scenario for this algorithm is when all elements in \(A \) are unique. The basic operation in this algorithm occurs within the innermost loop where the two elements are compared. The innermost loop occurs for \(j \) equal to \(i + 1 \) to n-1, inclusive. \[ \sum_{j=i+1}^{n-1} 1 = (n-1) - (i+1) + 1 = n - i - 1 \] The outermost loop occurs for \(i \) equal to \(0 \) to \(n - 2 \), inclusive. \[ \sum_{i=0}^{n-2} (n-1-j) = (n-1) - (n-2) + \dots + 1 = \sum_{i=1}^{n-1} i = \frac{n(n-1)}{2} \] Therefore, the algorithms worst-case efficiency is: \[ C_{worst}(n) = \frac{(n-1)n}{2} = \frac{1}{2}n^2 - \frac{1}{2}n \in O(n^2) \]

